def make_scattter(temp, key, folder=None, inde=None, metric_type='usage'):
    # temp 是一个列表 里面放了主机的字典
    # temp = sorted(temp, key=lambda x: x['avg'], reverse=True)  # 把列表里面的字典按照 平均值排序
    temp.sort(key=lambda t: t['avg'], reverse=True)
    # print(temp)
    length = 0  # 几个主机
    if len(temp) > 10:
        length = 10
        temp = temp[0: length]
    else:
        length = len(temp)
    print(length)
    plt.figure(key, figsize=figsize, dpi=120)

    x = np.array([[i]*10 for i in range(1, length+1)])
    print(len(x), x)

    if metric_type == 'usage':
        y = np.array([range(0, 100, 10)]*length)
        s = [[k[l] for l in k] for k in [j['distrib'] for j in temp]]  # [j['distrib'] for j in temp] 是一个含有字典的列表
        # j是一个主机的字典  k 是字典， l 是字典的 键， k[l] 就是分布字典的值   s是 所有的 主机的分布值的列表
        plt.ylabel('percent(%)', fontsize=ylabel)
        plt.yticks(np.arange(0, 101, 10), list(range(0, 101, 10)), fontsize=tick_size)

    else:
        # 数值监控项
        val_total = []
        for j in temp:
            val_total += j['distrib']  # 所有机器的列表

        o = min(val_total)
        p = max(val_total)
        step = (p - o) // 10
        temp_l = [o] + [o + step * r for r in range(1, 10)]
        dt = {q: 0 for q in temp_l}  # 生成总的 区间 字典
        print((o, p, step))
        y = np.array([range(o, p-step, step)] * length)
        print(len(y), y)

        s = []
        for host in temp:  # 每个主机
            # host_l = []  # 一个主机的列表
            dt_copy = copy.deepcopy(dt)
            for val in host['distrib']:  # host['distrib'] 是该主机所有值的列表
                # if (val - o) // step in dt_copy:  # 追加到 分布字典
                # dt_copy[o + step * (val - o) // step] += 1
                for d in dt_copy:
                    if val > d:
                        dt_copy[d] += 1
            host_l = list(dt_copy.values())

            s.append(host_l)
        print('s', s)
        plt.ylabel('bit/s', fontsize=ylabel)
        plt.yticks(fontsize=tick_size)

    y += 5

    plt.yticks(fontsize=tick_size)

    plt.tick_params(labelsize=tick_label)

    plt.grid(axis='y', linestyle=':')

    x_ticks = [m['host'] for m in temp]

    plt.xticks(np.arange(1, len(x_ticks) + 1), list(range(1, len(x_ticks) + 1)), fontsize=tick_size)  # x轴刻度
    plt.xlim(0, length + 5.4)  # 设置x轴范围

    ax = plt.gca()  # 设置顶轴，和右边轴消失
    ax.spines['top'].set_color('none')
    ax.spines['right'].set_color('none')

    label = []
    for i in range(1, len(x_ticks) + 1):
        ii = str(i) + ':%s'
        label.append(ii)
    label = (' \n'.join(label)) % tuple(x_ticks)
    plt.scatter(x, y, s=s, alpha=0.5, label=label)
    plt.legend(markerscale=0, handlelength=0)

    # plt.show()
    key = key if '/' not in key else key.replace('/', '')
    if not os.path.exists('%s' % folder):
        os.mkdir('%s' % folder)
    if inde:
        plt.savefig('%s/%s_%s.png' % (folder, key, inde))
        # 文件夹/监控项_第几组
    else:
        plt.savefig('%s/%s.png' % (folder, key))
    plt.close()


def query():
    host_l = []
    sql = 'select name from ecs_dep;'  # 查找机器host
    result = db.exec_sql(sql)
    if result:
        for d in result:
            host_l.append(d['name'])
    else:
        return
    metrics_total = {}
    # for metric in list(metric_usage) + list(metric_num):
    for metric in list(metric_usage) + list(metric_num):  # 测试用
        temp = []
        for host in host_l:
            # 每个主机
            sql = 'select value_num from ecs_data where host=%s and metric=%s and %s < time and time < %s;'
            val_l = db.exec_sql(sql, (host, metric, start_time, end_time))

            if val_l:  # 如果这个主机有值
                if metric in metric_usage:
                    dt = {x: 0 for x in range(0, 100, 10)}  # 分布的字典

                    val_total = []
                    for val_d in val_l:
                        val_num = val_d.get('value_num')  # 取值
                        if val_num:  # 这个字段有值
                            val_num = 100 - val_num
                            val_total.append(val_num)  # 追加到列表

                            if val_num // 10 * 10 in dt:  # 追加到 分布字典
                                dt[val_num // 10 * 10] += 1
                    temp.append({'distrib': dt, 'avg': sum(val_total)/len(val_total), 'host': host})  # 追加到该监控项的字典里
                else:  # 数值监控项 + 这个主机有值
                    val_total = []  # 所有值的列表
                    for val_d in val_l:
                        val_num = val_d.get('value_num')

                        if val_num:  # 这个字段有值
                            val_total.append(val_num)

                    temp.append({'distrib': val_total, 'avg': sum(val_total)/len(val_total), 'host': host})

            else:  # 如果主机没有值
                continue
        print(metric, temp)  # 每一个监控项， 每一个字典
        metrics_total[metric] = temp

    return metrics_total


